import "./SearchMovie.css";

const SearchMovie = () => {
  return (
    <div className="searchMovie shadow mx-auto mt-4 p-4">
      <input
        type="text"
        className="form-control p-3"
        placeholder="Kinolar qidirish..."
      />
      <div className="btn-group">
        <button className="btn btn-info">Barcha kinolar</button>
        <button className="btn btn-outline-info">Mashhur kinolar</button>
        <button className="btn btn-outline-info">Eng ko'p ko'rilgan kinolar</button>
      </div>
    </div>
  );
};

export default SearchMovie;
